INSERT INTO `news` VALUES (9,23,'Starcraft: New Update','On the 20th of July, Starcraft will become 10 years old. We would like to invite you to celebrate this glorious occasion together. There will be Starcraft tournaments with prizes as well as a Starcraft quiz about the lore.',_binary 'data:image/jpeg;base64,','2023-04-19 17:12:57'),(10,24,'World of Warcraft Update 1','The is the first World of Warcraft update for the year. There will be a new expansion soon called Dragonflights and, as the title suggests, it will be about the dragons from Azeroth. Join us at our press conference to learn more.',_binary 'data:image/jpeg;base64,','2023-04-20 11:57:19'),(11,25,'Warcraft 3 Update','Warcraft 3 is getting a Reforged addition. The Reforged package will include improved graphics for a more modern audience as well as different sounds for the units. More information about this grandiose project will be revealed at our press conference.',_binary 'data:image/jpeg;base64,','2023-04-21 15:03:19'),(12,0,'Red Scar Press Conference','A press conference for Red Scar will be held in Paris on the 23th of June. There, we will discuss potential ideas for new games as well as ideas for updating already existing games and making them better.',_binary 'data:image/jpeg;base64,','2023-05-09 10:42:41');
